import Header from "../components/header/Header";
import { Space, Table, Tag } from 'antd';

export const CartPage = () => {
    const dataSource = [
        {
          key: '1',
          name: 'Mike',
          age: 32,
          address: '10 Downing Street',
        },
        {
          key: '2',
          name: 'John',
          age: 42,
          address: '10 Downing Street',
        },
      ];
  return (
    <div>
      <Header />
      <div>
        <Table/>
      </div>
    </div>
  );
};
